+      floatingButtonStyle:{
+        backgroundColor: '#3F51B5',
+        color: '#fff',
+      },
+      icon: "https://mendable-storage.s3.amazonaws.com/autoGPT.gif",
+      botIcon: "https://mendable-storage.s3.amazonaws.com/autoGPTbot.gif",
+    })
+  </script>
+{% endraw %}
+{% endblock %}

